package _020_Arrays;

public class _090_Series {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int i[] = { 10, 20, 30, 40, 50 };

		System.out.println(i.length + " numbers are in i [] array\n");

		for (int x = 0; x < i.length; ++x) {
			System.out.printf("i[%d] = %d \n", x, i[x]);
		}

	}

}
